void openning()
{
	// 背景色設定	
	bkgd(COLOR_PAIR(8));
	char eventFlag[14];
	int y,x,z,i,j;
	int draw_x,draw_y;
	int drawStartChar=0;
	int move_y[14];
	int telopCount=0;
	
	for(i=0;i<14;i++){
		eventFlag[i]=TRUE;
		move_y[i]=-60;
	}
	while(eventFlag[13]==TRUE){
		// スクリーン初期化
		for(y=0;y<OPENNING_LINES;y++)
			for(x=0;x<OPENNING_COLS;x++)
				screen[y][x]=99;
		// スクリーン格納
		for(i=0;i<=drawStartChar;i++){
			//if(i>=drawStartChar)continue;
			// 文字描画座標調整
			switch(i){
				case 0:
					draw_y=48;	draw_x=0;
					break;
				case 1:
					draw_y=26;	draw_x=42;
					break;
				case 2:
					draw_y=22;	draw_x=87;
					break;
				case 3:
					draw_y=2;	draw_x=137;
					break;
				case 4:
					draw_y=-10;	draw_x=196;
					break;
				case 5:
					draw_y=131;	draw_x=13;
					break;
				case 6:
					draw_y=118;	draw_x=42;
					break;
				case 7:
					draw_y=102;	draw_x=74;
					break;
				case 8:
					draw_y=89;	draw_x=103;
					break;
				case 9:
					draw_y=72;	draw_x=131;
					break;
				case 10:
					draw_y=56;	draw_x=161;
					break;
				case 11:
					draw_y=41;	draw_x=189;
					break;
				case 12:
					draw_y=27;	draw_x=222;
					break;
				case 13:
					draw_y=15;	draw_x=252;
					break;
				default:
					break;
			}
			// スクリーン格納
			for(y=0;y<60;y++){
				for(x=0;x<60;x++){
					if(getColorInfo(OP[i][y][x])<64){
						if(eventFlag[i]==FALSE)
							screen[y+draw_y][x+draw_x]=OP[i][y][x];
						else{
							if( y+draw_y+move_y[i]<OPENNING_LINES&&
								y+draw_y+move_y[i]>=0&&
								x+draw_x<OPENNING_COLS&&
								x+draw_x>=0)
								screen[y+draw_y+move_y[i]][x+draw_x]=OP[i][y][x];	
						}
					}
				}
			}
		}	

		// スクリーン出力
		erase();
		for(y=0;y<OPENNING_LINES;y++){
			for(x=0;x<OPENNING_COLS;x++){
				attron(COLOR_PAIR(8));
				if(getColorInfo(screen[y][x])<64){
					attron(COLOR_PAIR(getColorInfo(screen[y][x])));
					for(z=0;z<2;z++)
						mvaddch(y,x*2+z,' ');
				}
			}
		}

		// 移動係数計算
		for(i=0;i<14;i++){
			if(move_y[i]>0){
				eventFlag[i]=FALSE;
				if(i==drawStartChar){
					if(++drawStartChar>=14)
						drawStartChar=13;
				}
			}
			else
				for(j=0;j<=drawStartChar;j++)
					move_y[j]++;
		}
		refresh();
		usleep(10000);
	}
	// テロップ描画
	if(eventFlag[13]==FALSE){
		int tY,tX;
		for(tY=0;tY<5;tY++){
			for(tX=0;tX<119;tX++){
				if(getColorInfo(startTelop[tY][tX])<64){
					screen[tY+154][(OPENNING_COLS-119)/2+tX]=startTelop[tY][tX];
				}
			}
		}
	}
	// スクリーン出力
	erase();
	for(y=0;y<OPENNING_LINES;y++){
		for(x=0;x<OPENNING_COLS;x++){
			attron(COLOR_PAIR(8));
			if(getColorInfo(screen[y][x])<64){
				attron(COLOR_PAIR(getColorInfo(screen[y][x])));
				for(z=0;z<2;z++)
					mvaddch(y,x*2+z,' ');
			}
		}
	}
	refresh();
	timeout(-1);
	getch();
	timeout(0);
	bkgd(COLOR_PAIR(6));
}

